function orbitalPeriod(arr) {
  var GM = 398600.4418;
  var earthRadius = 6367.4447;

  return arr.reduce((acc,obj)=>{
    var orbital=Math.round(2*Math.PI*Math.sqrt(Math.pow(earthRadius+ obj.avgAlt,3)/GM));
    acc.push({name:obj.name,orbitalPeriod:orbital})
    return acc
  },[])
}

